import {ContainerLastMatches, FontNameAndRanking,NameRanking, ContainerNameLastMatch} from '../style/style'
import axios from 'axios'
import { useEffect, useState } from 'react'



function LastMatchs () {   
    const [lastmatchs, setLastmatchs] = useState([])
    async function getLastMatchs () {
        const {data} = await axios.get('http://localhost:3333/lastmatchs')
        const reverse = data.reverse()
        setLastmatchs(reverse)
      
       
    }
    useEffect(() => {
        getLastMatchs()
    },[])


    return (
        <ContainerLastMatches>
            <FontNameAndRanking>
                Ãšltimas partidas
            </FontNameAndRanking>
            {lastmatchs.map((element, i) => {
               while(i <= 9 ) {
                   return (
                   <ContainerNameLastMatch>
                       <NameRanking>{element.p1} </NameRanking>
                        <NameRanking>{element.p2}</NameRanking>
                        </ContainerNameLastMatch>
                   )
               } 
            })}
        </ContainerLastMatches>
    )
}


export default LastMatchs
